		case UPDATE_PROCESSOR:
			state = state.set( action.processor.ID, processorFactory(
				action.processor.ID,
				action.processor.type,
				action.processor.configFields,
			));

			return clone(state);
		case  REMOVE_PROCESSOR:
			state.delete(action.processorId);
			return clone(state);
		default:
